import React from "react";
import { useNavigate } from "react-router-dom";

const HomePage = () => {
  const navigate = useNavigate();

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gradient-to-br from-blue-500 to-purple-600 text-white">
      <div className="text-center">
        <h1 className="text-5xl font-bold mb-4 animate-bounce">Welcome to Study Tracker</h1>
        <p className="text-lg mb-8">Enhancing student productivity with AI-powered tracking</p>
        <div className="flex space-x-6">
          <button
            onClick={() => navigate("/register")}
            className="px-6 py-3 bg-green-400 hover:bg-green-500 text-white rounded-lg shadow-lg transform hover:scale-105 transition-all"
          >
            Register
          </button>
          <button
            onClick={() => navigate("/login")}
            className="px-6 py-3 bg-blue-400 hover:bg-blue-500 text-white rounded-lg shadow-lg transform hover:scale-105 transition-all"
          >
            Login
          </button>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
